import React from 'react'
import styled from 'styled-components';

const Container = styled.div`
margin-top:1rem;
background:transparent;
display:flex;
flex-direction:column;
width:100%;
height:45rem;
align-items:center;
justify-content:center;

`;

function About() {
  return (
    <Container>
        <h2>About Us</h2>
    </Container>
  )
}

export default About
